import React from 'react';

const Stats = () => {
  return (
    <div className='stats' id='about'>
      <p>STATS</p>
      <div className='stats-box'>
        <div>
          <p>30+</p>
          <p>Teams</p>
        </div>
        <div>
          <p>19682+</p>
          <p className='lines-of-code'>Lines of code</p>
        </div>
        <div>
          <p>24</p>
          <p>Hours</p>
        </div>
      </div>
    </div>
  );
};

export default Stats;
